import React from 'react';
import { Row, Col } from 'antd';
class HomePage extends React.Component {
    render() {
        return (
            <>
            <Row>
      <Col className="left-content" span={4}>col-3</Col>
      <Col className="right-content" span={20}>col-18</Col>
    </Row>
  </>
        );
    }
}

export default HomePage;
